import ReactDOM from 'react-dom';

class HelloMessage extends React.Component {
  render() {
    return (
      <div>
        Hello {this.props.name} <br/>
        I am {this.props.age}
      </div>
    );
  }
}

ReactDOM.render(
  <HelloMessage name="Taylor" age="2"/>,
  document.getElementById('root')
);





